import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const Home = () => {
  return <h1>Welcome to the Home Page!</h1>;
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
};

export default App;
